import React from "react";
import { ArticleHelper } from "../components/ArticleHelper"; 
import "../styles/App.css";

export default function Projects() {
  const projects = [
    {
      title: "Go Web Scraper CLI",
      subtitle: "A command-line tool to scrape business websites for job postings.",
      technologies: ["Go", "Lipgloss", "HTTP", "Concurrency"],
      links: {
        github: "https://github.com/Mccullahz/go-job-scraper-cli",
      },
    },
    {
      title: "Holocube Pose Renderer",
      subtitle: "A 3D OpenPose renderer for volumetric holographic displays.",
      technologies: ["Python", "OpenGL", "OpenPose", "GLSL"],
      links: {
        github: "https://github.com/Mccullahz/holocube-visualizer",
      },
    },
    {
      title: "CPU Scheduler Simulator",
      subtitle: "A TUI simulation of CPU scheduling algorithms using Bubbletea.",
      technologies: ["Go", "Bubbletea", "Lipgloss"],
      links: {
        github: "https://github.com/Mccullahz/cpu-scheduling-sim",
      },
    },
    // Add more projects here as needed
  ];

  return (
    <main className="projects-page">
      <h1 style={{ fontSize: "2rem", marginBottom: "2rem" }}>Projects</h1>
      {projects.map((proj, idx) => (
        <div key={idx} className="project-entry" style={{ marginBottom: "2.5rem" }}>
          <ArticleHelper
            title={proj.title}
            subtitle={proj.subtitle}
            technologies={proj.technologies}
            links={proj.links}
          />
        </div>
      ))}
    </main>
  );
}
